import Paper from "@material-ui/core/Paper";

import FormStyles from "../styles/Form.module.scss";

const styles = {
  MuiPaper: {
    display: "flex",
    alignItems: "center",
    position: "absolute",
    top: 162,
    left: 23,
    right: 23,
    height: 128,
    backgroundColor: "rgba(26, 120, 194, 1)",
    padding: 40,
    boxSizing: "border-box",
    borderRadius: 10,
  },
  AccountIcon: {
    width: 80,
    height: 80,
  },
};

export default function Form() {
  return (
    <section className={FormStyles.Form}>
      <Paper style={styles.MuiPaper}>
        <div className={`${FormStyles.UserIcon} UserIcon`} />
        <p>Иванова Анна Михайловна</p>
      </Paper>
    </section>
  );
}
